import zlib

# 헥사 문자열을 바이트로 변환
hex_string = ""  # 쭉 이어서 입력
data = bytes.fromhex(hex_string)

# 범위 늘려가며 zlib 압축 해제 시도
for end in range(10, len(data), 1):
    try:
        decompressed = zlib.decompress(data[:end])
        print(f"\n✅ 성공! 끝 위치: {end}")
        print(decompressed.decode('utf-8', errors='replace'))
        break
    except Exception as e:
        print(f"❌ 실패 - {end} 바이트까지 시도: {e}")
